        t.exports = {
          about: '<div class="row">\n  <p>EthAddress.org is hosted on both <a href="https://ryepdx.github.io/ethaddress.org/">Github pages</a> and a <a href="https://ethaddress.org/">dedicated server</a> bought and provisioned by <a href="http://ryepdx.com">the website\'s maintainer</a>.</p>\n\n  <p>The source code can be found <a href="https://github.com/ryepdx/ethaddress.org">on Github</a>. For extra security, it\'s recommended that you download either <a href="https://ethaddress.org/tarball">the tarball</a> or <a href="https://ethaddress.org/zip">the zip file</a> of the signed HTML bundle (<a href="https://github.com/ryepdx/ethaddress.org/raw/master/index.html.sig">sig</a> &amp; <a href="http://ryepdx.com/ryepdx.gpg">key</a>) and run the website locally on an offline machine after verifying the signature. Alternatively, you could download the HTML bundle very quickly by just saving this page to your hard drive. (Not recommended if you plan on storing large sums of ether, though!)</p> \n\n  <p style="word-break: break-all">Donations are always welcome at <span on-click-select-all>0xa3acb4270415692cc4532a129534048364dcb1b2</span>.</p>\n\n  <p>Finally, you might have noticed that there is no entropy generation step as there is at websites like <a href="https://bitaddress.org/">BitAddress.org</a>. This website relies on the cryptographically strong <a href="https://developer.mozilla.org/en-US/docs/Web/API/RandomSource/getRandomValues">window.crypto.getRandomValues</a> function available in modern browsers, which harvests entropy from your OS\'s entropy pool. If you have reason to believe that this is insecure and are willing to school me on the subject, <a href="https://github.com/ryepdx/ethaddress.org/issues">open an issue</a> and we\'ll talk it out.</p>\n</div>\n', brainWallet: '<div class="row screen-only">\n  <div class="row">\n    <div class="col s12">\n      <div class="card-panel red">\n        <span class="white-text"><b>WARNING:</b> Brain wallets are only as     nav {

      width: 100%;

    }

    nav,
    nav a {
      color: #fff
    }

    nav .nav-wrapper {
      position: relative;
      height: 100%
    }

    @media only screen and (min-width:993px) {
      nav a.button-collapse {
        display: none
      }
    }

    nav .button-collapse {
      float: left;
      position: relative;
      z-index: 1;
      height: 56px
    }

    nav .brand-logo {
      position: absolute;
      color: #fff;
      display: inline-block;
      font-size: 2.1rem;
      padding: 0;
      white-space: nowrap
    }

    @media only screen and (max-width:992px) {
      nav .brand-logo {
        left: 50%;
        -webkit-transform: translateX(-50%);
        -moz-transform: translateX(-50%);
        -ms-transform: translateX(-50%);
        -o-transform: translateX(-50%);
        transform: translateX(-50%)
      }
    }

    nav .brand-logo.right {
      right: .5rem;
      padding: 0
    }

    nav ul {
      margin: 0
    }

    nav ul li {
      -webkit-transition: background-color .3s;
      -moz-transition: background-color .3s;
      -o-transition: background-color .3s;
      -ms-transition: background-color .3s;
      transition: background-color .3s;
      float: left;
      padding: 0
    }

    nav ul li:hover,
    nav ul li.active {
      background-color: rgba(0, 0, 0, .1)
    }

    nav ul a {
      font-size: 1rem;
      color: #fff;
      display: block;
      padding: 0 15px
    }

    nav ul.left {
      float: left
    }

      margin: 0
    }

    nav .input-field input {
      height: 100%;
      font-size: 1.2rem;
      border: none;
      padding-left: 2rem
    }

    nav .input-field input:focus,
    nav .input-field input[type=text]:valid,
    nav .input-field input[type=password]:valid,
    nav .input-field input[type=email]:valid,
    nav .input-field input[type=url]:valid,
    nav .input-field input[type=date]:valid {
      border: none;
      box-shadow: none
    }

    nav .input-field label {
      top: 0;
      left: 0
    }

    nav .input-field label.active {
      -webkit-transform: translateY(0);
      -moz-transform: translateY(0);
      -ms-transform: translateY(0);
      -o-transform: translateY(0);

    @font-face {
      font-family: "Roboto";
      src: url("fonts/Roboto-Medium.woff2") format("woff2"), url("fonts/Roboto-Medium.woff") format("woff"), url("fonts/Roboto-Medium.ttf") format("truetype");
      font-weight: 500
    }

    @font-face {
      font-family: "Roboto";
      src: url("fonts/Roboto-Bold.woff2") format("woff2"), url("fonts/Roboto-Bold.woff") format("woff"), url("fonts/Roboto-Bold.ttf") format("truetype");
      font-weight: 700
    }

    a {
      text-decoration: none
    }

    html {
      line-height: 1.5;
      font-family: "Roboto", sans-serif;
      font-weight: 400;
      color: rgba(0, 0, 0, .87)
    }

    @media only screen and (min-width:0) {
      html {
        font-size: 14px
      }
    }

    @media only screen and (min-width:992px) {
      html {
        font-size: 14.5px
      }
    }

    @media only screen and (min-width:1200px) {
      html {
        font-size: 15px
      }
    }

    strong {
      font-weight: 500
    }

    small {
      font-size: 75%
    }

    .card-panel {
      padding: 20px
    }

    .card-panel,
    .card {
      margin: .5rem 0 1rem;
      background-color: #fff;
      transition: box-shadow .25s;
      border-radius: 2px
    }

    .card {
      position: relative;
      overflow: hidden
    }

    .card .card-title {
      color: #fff;
      font-size: 24px;
      font-weight: 300
    }

    .card.small,
    .card.large {
      position: relative
    }

    .card.small .card-image,
    .card.large .card-image,
    .card.small .card-content,
    .card.large .card-content {
      overflow: hidden
    }

    .card.small .card-action,
    .card.large .card-action {
      position: absolute;
      bottom: 0;
      left: 0;
      right: 0
    }

    .card.small {
      height: 300px
    }

    .card.small .card-image,
    .card.small .card-content {
      height: 150px
    }

    .card.large {
      height: 500px
    }

    .card.large .card-image {
      height: 330px
    }

    .card.large .card-content {
      height: 170px
    }

    .card .card-image {
      position: relative
    }

    .card .card-image img {
      border-radius: 2px 2px 0 0;
      position: relative;
      left: 0;
      right: 0;
      top: 0;
      bottom: 0;
      width: 100%
    }

    .card .card-image .card-title {
      position: absolute;
      bottom: 0;
      left: 0;
      padding: 20px
    }

    .card .card-content {
      padding: 20px;
      border-radius: 0 0 2px 2px
    }

    .card .card-content p {
      margin: 0;
      color: inherit
    }

    .card .card-content .card-title {
      line-height: 48px
    }

    .card .card-action {
      border-top: 1px solid rgba(160, 160, 160, .2);
      padding: 20px
    }

    .card .card-action a {
      color: #ffab40;
      margin-right: 20px;
      -webkit-transition: color .3s ease;
      -moz-transition: color .3s ease;
      -o-transition: color .3s ease;
      -ms-transition: color .3s ease;
      transition: color .3s ease;
      text-transform: uppercase
    }

    .card .card-action a:hover {
      color: #ffd8a6
    }

    .btn {
      height: 36px;
      line-height: 36px
    }

    .btn,
    .btn-large {
      border: none;
      border-radius: 2px;
      display: inline-block;
      outline: 0;
      padding: 0 2rem;
      text-transform: uppercase;
      vertical-align: middle;
      -webkit-tap-highlight-color: transparent
    }

    .btn.disabled,
    .disabled.btn-large,
    .btn-large.disabled,
    .btn:disabled,
    .btn-large:disabled {
      background-color: #DFDFDF !important;
      box-shadow: none;
      color: #9F9F9F !important;
      cursor: default
    }

    .btn.disabled *,
    .disabled.btn-large *,
    .btn-large.disabled *,
    .btn:disabled *,
    .btn-large:disabled * {
      pointer-events: none
    }

    .btn.disabled:hover,
    .disabled.btn-large:hover,
    .btn-large.disabled:hover,
    .btn:disabled:hover,
    .btn-large:disabled:hover {
      background-color: #DFDFDF;
      color: #9F9F9F
    }

    .btn,
    .btn-large {
      text-decoration: none;
      color: #fff;
      background-color: #26a69a;
      text-align: center;
      letter-spacing: .5px;
      -webkit-transition: .2s ease-out;
      -moz-transition: .2s ease-out;

      }

      40% {
        opacity: 0
      }

      50%,
      75% {
        opacity: 1
      }

      76% {
        opacity: 0
      }
    }

      from,

        opacity: 0
      }

      50%,

      }

        opacity: 0
      }
    }

      }

      75%,

      }

        opacity: 0

      }

      }

      from {

      }

      50% {
        -webkit-transform: rotate(-5deg)
      }

      to {
        -webkit-transform: rotate(130deg)
      }
    }

      from {

      }

      50% {
        transform: rotate(-5deg)
      }

      to {

      }
    }

      }

        -webkit-transform: rotate(5deg)
      }

      to {
        -webkit-transform: rotate(-130deg)
      }
    }
